import React from "react";

const Photo = props => {

    const styles = {
        photo: {
            width: "100%",
            height: "100%",
            cursor: "pointer",
            backgroundImage: "url("+props.url+")",
            backgroundSize: "cover",
            backgroundPosition: "50%"
        }
    }

    return <div
    style={styles.photo}>
    </div>

};

export default Photo;
